#!/bin/bash

REGISTERTOKEN="a9f290a880384e70216345fe3c7e01177128fc1d"
RND=$RANDOM
MAIL="pepe$RND@botika.cat"
PASSW="pepebotika$RND"
NAME="PepeBotika$RND"

avatar=""

echo "=> register $MAIL"
curl -s localhost:3333/register -X POST -d '{"email":"'$MAIL'", "name":"'$NAME'", "password":"'$PASSW'", "invitationToken":"'$REGISTERTOKEN'"}'

echo "=> login with $PASSW"
jwt=$(curl -s localhost:3333/login -X POST -d '{"email":"'$MAIL'", "password":"'$PASSW'"}' | jq .token | tr -d \")
jwt="Authorization: BEARER $jwt"

echo "=> jwt is $jwt"

echo "=> profile for $NAME"
curl -s localhost:3333/profile -H "$jwt" | jq .

echo "=> update profile"
curl -s localhost:3333/profile -X POST -H "$jwt" -d '{"location":{ "latitude":42202259,"longitude":1815044}, "community":"Karabanchel" }' | jq .

echo "=> update profile with avatar"
curl -s localhost:3333/profile -X POST -H "$jwt" -d '{"avatar":"'$avatar'"}' | jq .

echo "=> get image avatar"
image=$(curl -s localhost:3333/profile -H "$jwt" | jq .avatarHash | tr -d \")
curl -s localhost:3333/images/$image -H "$jwt"

